                        non proident, sunt in culpa qui officia deserunt mollit
                        anim id est laborum.
                      </Event>
                    </Timeline>
                  </Fragment>
                </Paper>
              </Grid>
              <Grid item xs={4}>
                <Paper className={classes.paper}>
                  <h1>RELEVANT COURSES</h1>
                </Paper>
              </Grid>
              <Grid item xs={4}>
                <Paper className={classes.paper}>
                  <h1>TECHNICAL SKILLS</h1>
                </Paper>
              </Grid>
            </Grid>
          </div>
        </div>
      </div>
    );
  }
}
